export class EventProductOrder {
  constructor(id, amount, total, date, rentalPeriod, dateFrom, dateUntil, status, billed, seen, approved, sellingPrice, user, feeTransaction, event, product, shop, cart, deliveryType) {
    this.id = id;
    this.amount = amount;
    this.total = total;
    this.date = date;
    this.rentalPeriod = rentalPeriod;
    this.dateFrom = dateFrom;
    this.dateUntil = dateUntil;
    this.status = status;
    this.billed = billed;
    this.seen = seen;
    this.approved = approved;
    this.sellingPrice = sellingPrice;
    this.user = user;
    this.feeTransaction = feeTransaction;
    this.event = event;
    this.product = product;
    this.shop = shop;
    this.cart = cart;
    this.deliveryType = deliveryType;
    this.billed = this.billed ?? false;
    this.seen = this.seen ?? false;
    this.approved = this.approved ?? false;
  }
}
export function getEventProductOrderIdentifier(eventProductOrder) {
  return eventProductOrder.id;
}
